import React from "react";
import "./style.css";

function SaveButton ({saveButtonClick, id}) {

    return (


        <button data-id={id} onClick={(id) => {saveButtonClick(id)}} className="btn btn-info save-btn">Save</button>

    )

}

export default SaveButton;
